import React from 'react'
import Home from './Home'
import Dtav from './Components/Dtav/Dtav'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import './App.css';

function App() {

  return (
    <div className="App">
    <React.Fragment>
      <Router>
        <Switch>
          <Route path="/" element={<Home/>}/>
          <Route path="/dtav" element={<Dtav />} />
        </Switch>
    </Router>
  </React.Fragment>
  </div>
  );
}

export default App;
